params = {
	'col': self.getSibling("Column").custom.SelectedColumn,
	'bin': self.getSibling("Bin").custom.SelectedBin
}
res = system.db.runNamedQuery('Participants/Storage Bins/GetSpecificBinStatus', params)
res = system.dataset.toPyDataSet(res)

if len(res) == 0:
	return 'Available'

exitAction = res[0]['exitAction']
expireOn = res[0]['expireOn']

if system.date.isAfter(system.date.now(), expireOn):
	return 'Expired'
elif exitAction is None:
	return 'In-Use'
else:
	return 'Available'

